import React, { useEffect, useState } from "react";

function AgentsList() {
  const [agents, setAgents] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/agents")
      .then((res) => res.json())
      .then((data) => setAgents(data))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div>
      <h1>Zenless Zone Zero Agents</h1>
      {agents.map((agent) => (
        <div key={agent.AgentID} style={{border: "1px solid #ccc", margin: "10px", padding: "10px"}}>
          <h2>{agent.Name} ({agent.Specialty})</h2>
          <p>Faction: {agent.Faction}</p>
          <p>HP: {agent.HP} | ATK: {agent.ATK} | DEF: {agent.DEF}</p>
        </div>
      ))}
    </div>
  );
}

export default AgentsList;
